import classNames from "classnames";
import { useRef } from "react";
import { InputCheckboxComponent } from "./types";

export const InputCheckbox: InputCheckboxComponent = ({
  id,
  checked = false,
  disabled,
  onChange,
}) => {
  const { current: inputId } = useRef(`RampInputCheckbox-${id}`);

  function handleChangeCheckbox(event: React.ChangeEvent<HTMLInputElement>) {
    const newEventChecked = event.target.checked;
    onChange(newEventChecked);

    console.log("Executando...");
  }

  return (
    <form onSubmit={handleChangeCheckbox}>
      <div className="RampInputCheckbox--container" data-testid={inputId}>
        <label
          className={classNames("RampInputCheckbox--label", {
            "RampInputCheckbox--label-checked": checked,
            "RampInputCheckbox--label-disabled": disabled,
          })}
        />
        <input
          id={inputId}
          type="checkbox"
          className="RampInputCheckbox--input"
          checked={checked}
          disabled={disabled}
          onChange={handleChangeCheckbox}
        />
      </div>
    </form>
  );
};
